            <LockOutlinedIcon/>
        </Avatar>
        <typography varient="h5">{isSignUp ? 'Sign Up' : 'Sign In' }</typography>
        <form className={classes.form} onSubmit={handleSubmit}></form>
      </paper>

</Container>
  );
};

